define({"topics" : [{"title":"Record Functions","shortdesc":"\n               <p class=\"shortdesc\">Use record functions to determine information about a record, such as the stage that   created it or whether a field exists\n                  in the record. \n               </p>\n            ","href":"datacollector\/UserGuide\/Expression_Language\/Functions.html#concept_p1z_ggv_1r","attributes": {"data-id":"concept_p1z_ggv_1r",},"menu": {"hasChildren":false,},"tocID":"concept_p1z_ggv_1r-d46e177474","topics":[]},{"title":"Delimited Data Record Functions","shortdesc":"\n               <p class=\"shortdesc\">Use delimited data record functions to process delimited data with the list root field   type. If you configured an origin\n                  to process the delimited data with the list-map root field type,   you can use standard record functions.\n               </p>\n            ","href":"datacollector\/UserGuide\/Expression_Language\/Functions.html#concept_s2c_q14_fs","attributes": {"data-id":"concept_s2c_q14_fs",},"menu": {"hasChildren":false,},"tocID":"concept_s2c_q14_fs-d46e177499","topics":[]},{"title":"Error Record Functions","shortdesc":"\n               <p class=\"shortdesc\">Error record functions provide information about error records. Use error functions to   process error records.</p>\n            ","href":"datacollector\/UserGuide\/Expression_Language\/Functions.html#concept_ndj_43v_1r","attributes": {"data-id":"concept_ndj_43v_1r",},"menu": {"hasChildren":false,},"tocID":"concept_ndj_43v_1r-d46e177534","topics":[]},{"title":"Base64 Functions","shortdesc":"\n               <p class=\"shortdesc\">Use Base64 functions to encode or decode data using Base64.</p>\n            ","href":"datacollector\/UserGuide\/Expression_Language\/Functions.html#concept_ylk_v44_jw","attributes": {"data-id":"concept_ylk_v44_jw",},"menu": {"hasChildren":false,},"tocID":"concept_ylk_v44_jw-d46e177579","topics":[]},{"title":"Credential Functions","href":"datacollector\/UserGuide\/Expression_Language\/Functions.html#concept_yvc_3qs_r1b","attributes": {"data-id":"concept_yvc_3qs_r1b",},"menu": {"hasChildren":false,},"tocID":"concept_yvc_3qs_r1b-d46e177634","topics":[]},{"title":"Category Functions","shortdesc":"\n               <p class=\"shortdesc\">Category functions are functions that you use only <span class=\"ph\">in <a class=\"xref\" href=\"reusable-content\/https:\/\/streamsets.com\/documentation\/controlhub\/latest\/help\/controlhub\/UserGuide\/DataProtector\/DataProtector-Overview.html#concept_ws1_w2b_v2b\" target=\"_blank\"><span class=\"ph\"><span class=\"ph\">Data Protector</span></span></a>                 protection procedures when using certain protection methods, such as the <a class=\"xref\" href=\"reusable-content\/https:\/\/streamsets.com\/documentation\/controlhub\/latest\/help\/controlhub\/UserGuide\/ProtectionMethods\/Method-ExpressionEval.html\" target=\"_blank\"><span class=\"ph\">Expression                     Evaluator</span></a></span>, <a class=\"xref\" href=\"datacollector\/UserGuide\/Expression_Language\/https:\/\/streamsets.com\/documentation\/controlhub\/latest\/help\/controlhub\/UserGuide\/ProtectionMethods\/Method-StandardMask.html\" target=\"_blank\"><span class=\"ph\">Standard Mask</span></a>, or <a class=\"xref\" href=\"datacollector\/UserGuide\/Expression_Language\/https:\/\/streamsets.com\/documentation\/controlhub\/latest\/help\/controlhub\/UserGuide\/ProtectionMethods\/Method-CustomMask.html\" target=\"_blank\"><span class=\"ph\">Custom Mask</span></a>.\n               </p>\n            ","href":"datacollector\/UserGuide\/Expression_Language\/Functions.html#concept_ntw_fc5_kfb","attributes": {"data-id":"concept_ntw_fc5_kfb",},"menu": {"hasChildren":true,},"tocID":"concept_ntw_fc5_kfb-d46e177696","next":"concept_ntw_fc5_kfb-d46e177696",},{"title":"Data Drift Functions","shortdesc":"\n               <p class=\"shortdesc\">Use data drift functions to create alerts when data drift occurs. You can use these         functions in data drift rules.</p>\n            ","href":"datacollector\/UserGuide\/Expression_Language\/Functions.html#concept_hpn_xfk_p5","attributes": {"data-id":"concept_hpn_xfk_p5",},"menu": {"hasChildren":false,},"tocID":"concept_hpn_xfk_p5-d46e178305","topics":[]},{"title":"Data Generation Functions","shortdesc":"\n               <p class=\"shortdesc\">Data generation functions are functions that you use only <span class=\"ph\">in <a class=\"xref\" href=\"reusable-content\/https:\/\/streamsets.com\/documentation\/controlhub\/latest\/help\/controlhub\/UserGuide\/DataProtector\/DataProtector-Overview.html#concept_ws1_w2b_v2b\" target=\"_blank\"><span class=\"ph\"><span class=\"ph\">Data Protector</span></span></a>                 protection procedures when using certain protection methods, such as the <a class=\"xref\" href=\"reusable-content\/https:\/\/streamsets.com\/documentation\/controlhub\/latest\/help\/controlhub\/UserGuide\/ProtectionMethods\/Method-ExpressionEval.html\" target=\"_blank\"><span class=\"ph\">Expression                     Evaluator</span></a></span>.\n               </p>\n            ","href":"datacollector\/UserGuide\/Expression_Language\/Functions.html#concept_kwf_yqb_lfb","attributes": {"data-id":"concept_kwf_yqb_lfb",},"menu": {"hasChildren":true,},"tocID":"concept_kwf_yqb_lfb-d46e178441","next":"concept_kwf_yqb_lfb-d46e178441",},{"title":"Field Functions","shortdesc":"\n               <p class=\"shortdesc\">You can use field functions in field path expressions that determine the set of         fields that a processor uses. Each\n                  function is evaluated against a set of matching fields         individually.\n               </p>\n            ","href":"datacollector\/UserGuide\/Expression_Language\/Functions.html#concept_gfs_w55_3cb","attributes": {"data-id":"concept_gfs_w55_3cb",},"menu": {"hasChildren":false,},"tocID":"concept_gfs_w55_3cb-d46e178914","topics":[]},{"title":"File Functions","href":"datacollector\/UserGuide\/Expression_Language\/Functions.html#concept_kxj_nyl_5x","attributes": {"data-id":"concept_kxj_nyl_5x",},"menu": {"hasChildren":false,},"tocID":"concept_kxj_nyl_5x-d46e179091","topics":[]},{"title":"Job Functions","href":"datacollector\/UserGuide\/Expression_Language\/Functions.html#unique_282294219","attributes": {"data-id":"unique_282294219",},"menu": {"hasChildren":false,},"tocID":"unique_282294219-d46e179275","topics":[]},{"title":"Math Functions","href":"datacollector\/UserGuide\/Expression_Language\/Functions.html#concept_m2m_s1f_lw","attributes": {"data-id":"concept_m2m_s1f_lw",},"menu": {"hasChildren":false,},"tocID":"concept_m2m_s1f_lw-d46e179469","topics":[]},{"title":"Pipeline Functions","href":"datacollector\/UserGuide\/Expression_Language\/Functions.html#concept_dvg_nqn_wx","attributes": {"data-id":"concept_dvg_nqn_wx",},"menu": {"hasChildren":false,},"tocID":"concept_dvg_nqn_wx-d46e179673","topics":[]},{"title":"String Functions ","href":"datacollector\/UserGuide\/Expression_Language\/Functions.html#concept_ahp_f4v_1r","attributes": {"data-id":"concept_ahp_f4v_1r",},"menu": {"hasChildren":false,},"tocID":"concept_ahp_f4v_1r-d46e179887","topics":[]},{"title":"Time Functions","shortdesc":"\n               <p class=\"shortdesc\">Use time functions to return the current time or to transform datetime         data.</p>\n            ","href":"datacollector\/UserGuide\/Expression_Language\/Functions.html#concept_qkr_trf_sw","attributes": {"data-id":"concept_qkr_trf_sw",},"menu": {"hasChildren":false,},"tocID":"concept_qkr_trf_sw-d46e180111","topics":[]},{"title":"Miscellaneous Functions","href":"datacollector\/UserGuide\/Expression_Language\/Functions.html#concept_ddw_ld1_1s","attributes": {"data-id":"concept_ddw_ld1_1s",},"menu": {"hasChildren":false,},"tocID":"concept_ddw_ld1_1s-d46e180348","topics":[]}]});